def solve(lst):
    def rec(left, right):
        if left == right:
            return 0
        res = 0
        if not 0 in lst[left:right]:
            m = min(lst)
            for i in range(left, right):
                lst[i] = lst[i] - m
            res += m
        m = 1000
        for i in range(left, right):
            if lst[i] > 0:
                m = min(m, lst[i])
            else:
                for j in range(left, i):
                    lst[j] = lst[j] - m
                if left != i:
                    res += m
                return res + rec(left, i) + rec(i+1, right)
    return rec(0, len(lst))


