def main():
    N,K = list(map(int, sys.stdin.readline().split()))
    A_list = list(map(int, sys.stdin.readline().split()))

    A_plus = []
    A_minus = []
    mod = 10**9 + 7

    for val in A_list:
        if val >= 0:
            A_plus.append(val)
        else:
            A_minus.append(val)


    A_plus.sort(reverse=True)
    A_minus.sort()

    if (not A_plus):
        ans = 1

        for i in range( len(A_minus)-K, len(A_minus) ):
            ans *= A_minus[i]
            ans %= mod

        print(ans)
        return


    if (not A_minus):
        ans = 1

        for i in range(K):
            ans *= A_plus[i]
            ans %= mod

        print(ans)
        return


    select = []
    i_p = 0  # index of A_plus
    i_m = 0  # index of A_minus

    while (len(select) < K) and (i_p < len(A_plus)) and (i_m < len(A_minus)):
        if (K - len(select)) == 1:
            select.append( A_plus[i_p] )
            i_p += 1
            break

        if (i_m + 1) < len(A_minus):
            if (i_p + 1) < len(A_plus):
                if abs( A_plus[i_p] * A_plus[i_p + 1] ) > abs( A_minus[i_m] * A_minus[i_m + 1] ):
                    select.append( A_plus[i_p] )
                    i_p += 1
                else:
                    select.extend( [ A_minus[i_m] , A_minus[i_m + 1] ] )
                    i_m += 2

            else:
                select.extend( [ A_minus[i_m] , A_minus[i_m + 1] ] )
                i_m += 2

        else:
            select.append( A_plus[i_p] )
            i_p += 1



    ans = 1

    for i in range(K):
        ans *= select[i]
        ans %= mod

    print(ans)
    return


