uf = UnionFind(2 * H * W)  # 全頂点 * 2
for r in range(H):
    for c in range(W):
        if s[r][c] == '#':
            for i in range(4):
                nr = r + dr[i]
                nc = c + dc[i]
                if 0 <= nr < H and 0 <= nc < W:
                    if s[nr][nc] == '.':
                        uf.unite(r * W + c, (nr * W + nc) * 2)  # #: *1, .: * 2
        else:
            for i in range(4):
                nr = r + dr[i]
                nc = c + dc[i]
                if 0 <= nr < H and 0 <= nc < W:
                    if s[nr][nc] == '#':
                        uf.unite((r * W + c) * 2, nr * W + nc)  # #: *1, .: * 2

ans = 0
for r in range(H):
    for c in range(W):
        if uf.root(r * W + c):
            sz = uf.size(r * W + c)

            wt = sz // 2
            bk = sz - wt
            ans += wt * bk

        elif uf.root((r * W + c) * 2):
            sz = uf.size((r * W + c) * 2)

            bk = sz // 2
            wt = sz - bk
            ans += wt * bk

print(ans)

