import sys

def calc(A, b):
    c = 0
    for i, x in enumerate(A):
        c += abs(x - (b + (i+1)))
    return c

def solve(N, A):
    B = []
    for i, a in enumerate(A):
        B.append(a - (i+1))
    return calc(A, sorted(B)[N // 2])

