import numpy as np


class Person:
    def __init__(self, list_score_my, list_score_other, list_eatable):
        self.list_score_my = list_score_my
        self.list_score_other = list_score_other
        self.list_eatable = list_eatable
        self.eatable = True
        self.score_sum = 0

    # other
    def get_score_max_other(self):
        return np.max(self.list_score_other)

    def get_score_max_other_eatable(self):
        return np.max(self.list_score_other * self.list_eatable)

    def get_index_of_score_max_other_eatable(self):
        return np.where(self.list_score_other == self.get_score_max_other_eatable())

    def is_other_has_same_max_score(self):
        flag = 0
        score_other_max = np.max(self.list_score_other)
        for i in self.list_score_other:
            if(self.list_score_other[i] == self.score_other_max):
                flag += 1

        if(flag > 1):
            return True
        else:
            return False

    # my
    def get_score_max_my(self):
        return np.max(self.list_score_my)

    def get_score_max_my_eatable(self):
        return np.max(self.list_score_my * self.list_eatable)

    def get_index_of_score_max_my_eatable(self):
        return np.where(self.list_score_my == self.get_score_max_my_eatable())

    def is_i_have_same_max_score(self):
        flag = 0
        self.score_my_max = np.max(self.list_score_my)
        for i in range(len(self.list_score_my)):
            if(self.list_score_my[i] == self.score_my_max):
                flag += 1
        if(flag > 1):
            return True
        else:
            return False

    def eat(self, index):
        self.list_eatable[index] = False
        self.score_sum += self.list_score_my[index]

    def print_score(self):
        print(self.list_score_my)


