S = input()

a = [0 for i in range(len(S))]
q = [0 for i in range(len(S))]
counta,countq = 0,0
for i in range(len(S)):
    if S[i] == 'A':
        counta += 1
    elif S[i] == '?':
        countq += 1
    a[i] =counta
    q[i] =countq

def ab(x):
    if len(x) == 1:
        return 0
    if x[len(x)-1] == '?':
        return ab(x[:-1])*3 \
                +a[len(x)-1-1]*pow(3,q[len(x)-1-1])\
                +q[len(x)-1-1]*pow(3,q[len(x)-1-1]-1)
    elif x[len(x)-1] == 'B':
        return  ab(x[:-1]) \
                +a[len(x)-1-1]*pow(3,q[len(x)-1-1])\
                +q[len(x)-1-1]*pow(3,q[len(x)-1-1]-1)
    else:
        return ab(x[:-1])
ab_ = [ab(S[:i+1]) for i in range(len(S))]

def abc(x):
    if len(x) == 2:
        return 0
    if x[len(x)-1] == '?':
        return abc(x[:-1])*3 +ab_[len(x)-1-1]
    elif x[len(x)-1] == 'C':
