import sys

def solve(N, M, A, B, C):
    key = []  # type: "List[List[int, int]]"
    for i in range(M):
        s = 0
        for j in range(B[i]):
            s |= 1 << (C[i][j] - 1)
        key.append([s, A[i]])

    INF = 1001001001
    dp = [INF] * (1 << N)
    dp[0] = 0
    for s in range(1 << N):
        for i in range(M):
            t = s | key[i][0]
            cost = dp[s] + key[i][1]
            dp[t] = min(dp[t], cost)
    ans = dp[-1]
    print(-1 if ans == INF else ans)
    pass


