def flipCard(row, column, table):
    for r in range(3):
        for c in range(3):
            if row + (r-1) < 0 or column + (c-1) < 0:
                pass
            elif row + (r-1) >= N or column + (c-1) >= M:
                pass
            else:
                card = table[row + (r-1)][column + (c-1)]
                if card == '.':
                    card = '#'
                else :
                    card = '.'
                table[row + (r-1)][column + (c-1)] = card
    return table

