import sys
from itertools import combinations


def gen_step(s, n):
    # 和がsとなるn個の非負整数列
    # a1 + a2 + ... + an = s
    if n == 0:
        yield []
        return
    if n == 1:
        yield [s]
        return
    for i in range(s + 1):
        for step in gen_step(s - i, n - 1):
            yield [i] + step


def solve(N: int, M: int, Q: int, a: "List[int]", b: "List[int]", c: "List[int]", d: "List[int]"):
    ans = 0
    for s in range(M):
        for steps in gen_step(s, N - 1):
            ret = 0
            A = [1] * N
            for i, step in enumerate(steps):
                A[i + 1] = A[i] + step
            for q in range(Q):
                if A[b[q] - 1] - A[a[q] - 1] == c[q]:
                    ret += d[q]
            ans = max(ans, ret)
    print(ans)
    return


