INF = int(1e14)


def same_ratio(a1: int, b1: int, a2: int, b2: int):
    assert a1 > 0 and b1 > 0 and a2 > 0 and b2 > 0
    r = max(a1, a2) / min(a1, a2)
    return (a1 * r == a2 and b1 * r == b2) or (a1 == a2 * r and b1 == b2 * r)


def main():
    N, Ma, Mb = map(int, input().split())
    l = []
    for _ in range(N):
        l.append(tuple(map(int, input().split())))

    ans = INF
    dp = [[[INF] * 401 for i in range(401)] for j in range(N + 1)]
    dp[0][0][0] = 0

    max_a, max_b = 1, 1
    for i in range(N):

        for a in range(max_a, -1, -1):
            for b in range(max_b, -1, -1):
                if dp[i][a][b] != INF:
                    dp[i + 1][a + l[i][0]][b + l[i][1]] = min(dp[i + 1][a + l[i][0]][b + l[i][1]], dp[i][a][b] + l[i][2])
                    dp[i + 1][a][b] = min(dp[i + 1][a][b], dp[i][a][b])

                    max_a = max(max_a, a + l[i][0])
                    max_b = max(max_b, b + l[i][1])

                c = dp[i][a][b]
                if a != 0 and b != 0 and c < ans and same_ratio(a, b, Ma, Mb):
                    ans = min(ans, c)

    print((-1 if ans == INF else ans))

