def xcounter(s,nx):
    l=len(s)
    cl=[0]*(nx)
    i=tc=0
    while tc<nx:
        if s[i]!='x':
            if i==l-1:cl[tc]=0
            else:
                i+=1
                c=0
                while i<l:
                    if s[i]=='x':
                        i+=1
                        c+=1
                    else:
                        cl[tc]=c
                        break
                else:cl[tc]=c
        tc+=1
    return cl

