class Monster():
	def __init__(self, hp, A, B):
		self.hp = hp
		self.live = 1
		self.center = A
		self.side = B

	def is_die(self):
		if self.hp <= 0:
			self.live = 0

	def center_bombed(self):
		self.hp -= self.center
		self.is_die()

	def side_bombed(self):
		self.hp -= self.side
		self.is_die()

N, A, B =[int(i) for i in input().split()]
monsters = []
counter = 0
for i in range(N):
	h = int(input())
	monsters.append(Monster(h, A, B))

while True:
	NN = len(monsters)
	hp_of_monsters = [m.hp for m in monsters]
	MAX = max(hp_of_monsters)
	number = hp_of_monsters.index(MAX)
	for i in range NN:
		if i == number:
			monsters[i].center_bombed()
		else:
			monsters[i].side_bombed()
	counter += 1
	monsters = [m for m in monsters if m.live == 1]
	if len(monsters) == 0:
		print(counter)
		return

