def subst(S, T)-> int:
  lenT = len(T)
  result = lenT
  for i in range(len(S) - lenT):
    # tempS = S[i-lenT]
    tempResult = 0
    for j in range(lenT):
      if T[j] != S[j + i]:
        tempResult += 1
    if tempResult < result:
      result = tempResult

  return result

