def bellman_ford(vertex_num: int, edges: list, source: int) -> list:
    distances = [float('inf')] * (vertex_num)
    distances[source] = 0

    for _ in range(vertex_num-1):
        for u, v, c in edges:
            distances[v] = min(distances[v], distances[u] + c)

    for u, v, c in edges:
        if distances[u] + c < distances[v] and v == vertex_num-1:
            return []

    return distances


def score_attack(N: int, M: int, edges: list) -> int:
    distances = bellman_ford(N, [(u-1, v-1, -c) for u, v, c in edges], 0)

    return -distances[N - 1] if distances else float('inf')


