import numpy as np

def conv(A,N):
    #A(座標iの電灯の強さリスト)からB(座標iを照らしている電灯数)への変換
    B=np.array([0 for n in range(N)])
    for n in range(1,N+1):
        il_min=max(int(n-A[n-1]-0.5)+1,0)
        il_max=min(int(n+A[n-1]+0.5),N)
        fore=np.zeros(il_min-1,dtype=int)
        back=np.zeros(N-il_max,dtype=int)
        cent=np.ones(il_max-il_min+1,dtype=int)
        C=np.hstack((fore,cent,back))
        B+=C
    return B

def main():
    #input
    N,K=map(int,input().strip().split())
    A=np.array(list(map(int,input().strip().split())),dtype=int)

    for k in range(K):
        B=conv(A,N)
        if np.allclose(A, B):
            break
        else:
            A=B
    return " ".join(list(map(str,A)))

