@mt
def slv(N, S):
    b = []
    for s in S:
        bottom = 0
        cur = 0
        for c in s:
            if c == '(':
                cur += 1
            else:
                cur -= 1
            bottom = min(bottom, cur)
        b.append((bottom, cur))

    bp = [_ for _ in b if _[1] > 0]
    bn = [_ for _ in b if _[1] <= 0]
    bp.sort(key=lambda x: x[0], reverse=True)
    bn.sort(key=lambda x: x[1], reverse=True)

    cur = 0
    for bt, ct in bp:
        if cur + bt < 0:
            return 'No'
        cur += ct

    for bt, ct in bn:
        if cur + bt < 0:
            return 'No'
        cur += ct

    if cur != 0:
        return 'No'
    return 'Yes'



