@mt
def slv(N, A):
    m = N // 2
    dp = [defaultdict(lambda: -INF)] * 2
    dp[0][0] = 0
    for i, a in enumerate(A):
        ndp = [defaultdict(lambda: -INF)] * 2
        l = m - ((N-i) // 2)
        ndp[0] = dp[1]
        for k, v in dp[0].items():
            if k+1 >= l:
                ndp[1][k+1] = max(ndp[1][k+1], v+a)
            if k+2 >= l:
                ndp[0][k] = max(ndp[0][k], v)
        dp = ndp
    return max(dp[0][m], dp[1][m])


