        print("not coprime")
        exit()

    max_n = 10 ** 3 + 1
    div = [True for _ in range(max_n)]
    div[0] = div[1] = False
    prime_lst = []
    for i in range(2, int(max_n ** 0.5 + 1)):
        if not div[i]:
            continue
        prime_lst.append(i)
        for j in range(i * 2, max_n, i):
            div[j] = False
    tf = [False for _ in range(max_n)]
    for i in range(n):
        for pr in prime_lst:
            if alst[i] % pr == 0:
                if tf[pr]:
                    print("setwise coprime")
                    exit()
                while alst[i] % pr == 0:
                    alst[i] //= pr
                    tf[pr] = True
    alst.sort()
    bef = 1
    for a in alst:
        if a == 1:
            continue
        elif a == bef:
            print("setwise coprime")
            exit()
        bef = a
    print("pairwise coprime")
