import sys
def input(): return sys.stdin.readline().rstrip()


def kaisuu(moto, shitai):
    return (moto-1) // shitai


def is_ok(arg, dlist, k):
    # 条件を満たすかどうか？問題ごとに定義
    num = map(lambda x: kaisuu(x, arg), dlist)
    return sum(num) <= k


def meguru_bisect(ng, ok, dlist, k):
    '''
    初期値のng,okを受け取り,is_okを満たす最小(最大)のokを返す
    まずis_okを定義すべし
    ng ok は  とり得る最小の値-1 とり得る最大の値+1
    最大最小が逆の場合はよしなにひっくり返す
    '''
    while (abs(ok - ng) > 1):
        mid = (ok + ng) // 2
        if is_ok(mid, dlist, k):
            ok = mid
        else:
            ng = mid
    return ok


def main():
    n, k = map(int, input().split())
    A = list(map(int, input().split()))
    print(meguru_bisect(0, 10**9+1, A, k))


