def comb(n, r):
	# return factorial(n) // factorial(r) // factorial(n-r)
	r = min(r, n-r)
	ans = 1
	for i in range(n-r+1, n+1):
		ans *= i
	for i in range(2, r+1):
		ans //= i
	return ans

def ABC094D(n, a):
    a = sorted(a)[::-1]
    Max = 0
    for i in range(n-1):
        for j in range(i, n):
            ans = comb(a[i], a[j])
            if ans > Max:
                Max, a1, a2 = ans, a[i], a[j]
    print(a1, a2, Max)

