def code_for_D(N, K, test=None):

    if not test:
        N, K = map(int, input().split())

    n_max_blue = K
    n_max_red = N-K
    n_ways_of_arrange = [0] * K

    def count_ways(prev, n_blue, n_red, n_operate):
        if n_blue == n_max_blue and n_red == n_max_red:
            n_ways_of_arrange[n_operate - 1] += 1
            return

        if n_blue > n_max_blue or n_red > n_max_red:
            return

        count_ways('r', n_blue, n_red + 1, n_operate)

        if prev != 'b':
            n_operate += 1
        count_ways('b', n_blue + 1, n_red, n_operate)

        return

    count_ways('', 0, 0, 0)

    mod = 10**9 + 7
    for i in n_ways_of_arrange:
        if i:
            print(i % mod)

