from bisect import bisect_left

def mix(abc,Ma,Mb):
    n = len(abc)
    OP = []
    for i in range(2**n):
        i_bin = bin(i)[2:]
        if len(i_bin) < n:
            pad = "0" * (n-len(i_bin))
            i_bin = pad + i_bin
        a,b,c = 0,0,0
        for j in range(len(i_bin)):
            if i_bin[j] == "1":
                a += abc[j][0]
                b += abc[j][1]
                c += abc[j][2]
        d = Mb*a-Ma*b
        OP.append((d,c))
    OP.sort(key = lambda x:x[0])
    return OP

