def prime_factorize(n):
    a = 1
    if n <= 10 ** 9:
        return n

    while n % 2 == 0:
        n //= 2
        a *= 2

    if n <= 10 ** 9:
        return n
    f = 3
    while f * f <= n:
        if n // a <= 10 ** 9:
            return a
        if n % f == 0:
            n //= f
            a *= f
        else:
            f += 2


