def solve():
    s = input()
    s = [ord(i) - ord("a") for i in s]
    N = len(s)
    t = input()
    t = [ord(i) - ord("a") for i in t]

    posit = {}
    for i in range(0, ord("z")-ord("a")+1):
        posit[i] = []

    for i, c in enumerate(s):
        posit[c].append(i)

    ans = 0
    cur = -1
    for src_target in t:
        if not posit[src_target]:
            return -1
        if posit[src_target][-1] <= cur: # 使い捨て処理
            ans += (N-cur)
            cur = 0
            #print("a", ans)
        idx = bisect_left(posit[src_target], cur+1) # 次のがあるindexを探す
        next = posit[src_target][idx]
        ans += next - cur
        cur = next
        #print(ans, src_target)

    return ans



