from functools import lru_cache
N = int(input())
A = list(map(int, input().split()))


@lru_cache(maxsize=None)
def rec(i, reverse):
    if i == N - 1:
        return A[i] * reverse

    num_normal = rec(i + 1, +1) + (A[i] * reverse)
    num_reverse = rec(i + 1, -1) + (-A[i] * reverse)

    return max(num_normal, num_reverse)


