from fractions import gcd

def create_primeNum(N):
    if N == 1:
        return 1
    primeNum=1
    for k in range(2, N + 1):
        # 2以外の偶数は素数ではないので無視する
        if k % 2 == 0 and k != 2:
            continue
        if pow(2, k - 1, k) == 1:
            primeNum += 1
    return primeNum

