def error_print(*args):
    print(*args, file=sys.stderr)


def mt(f):
    import time

    def wrap(*args, **kwargs):
        s = time.time()
        ret = f(*args, **kwargs)
        e = time.time()

        error_print(e - s, 'sec')
        return ret

    return wrap


@mt
def slv(N, M, L, ABC, Q, ST):

    g = defaultdict(dict)
    for a, b, c in ABC:
        g[a][b] = c
        g[b][a] = c

    def f(s, t):
        q = [(0, s)]
        done = set([s])
        d = 0
        while q:
            d, u = heapq.heappop(q)
            qq = [(L, u)]
            cand = set([u])
            while qq:
                rem, uu = heapq.heappop(qq)
                for vv in g[uu]:
                    if rem-g[uu][vv] < 0:
                        continue
                    if vv in cand or vv in done:
                        continue
                    qq.append((rem-g[uu][vv], vv))
                    cand.add(vv)
            if t in cand:
                return d

            done |= cand
            for v in cand:
                heapq.heappush(q, (d+1, v))
        return -1

    for s, t in ST:
        print(f(s, t))



