def is_8_factors(n):
    nfactors = 2
    upper = n
    div = 3
    while True:
        if upper <= div:
            break
        if n % 3 == 0:
            nfactors += 2
            upper = n // 3
        div += 2

    return True if nfactors == 8 else False

