def func(pos, t, x):

    if pos + t == x:
        return t
    elif pos + t < x:
        new_pos = pos + t
        t += 1
        return func(new_pos, t, x)
    else:
        new_pos = pos - t
        t -= 1
        return func(new_pos, t, x)

