# Binary Indexed Tree (Fenwick Tree)
class BIT():
    def __init__(self, n):
        self.n = n
        self.bit = [[0] * (n + 1) for _ in range(26)]

    def add(self, i, value, idx):
        i = i + 1
        while i <= self.n:
            self.bit[idx][i] += value
            i += i & -i

    def _sum(self, i , idx):
        s = 0
        while i > 0:
            s += self.bit[idx][i]
            i -= i & -i
        return s

    def sum(self, l, r, idx):
        return self._sum(l, idx) - self._sum(r, idx)

