import sys


def omit(n, links, parents):
    def remove_child(v):
        for u in parents[v]:
            if u == v:
                continue
            links[u].remove(v)
            ps = links[u]
            if not ps or (len(ps) == 1 and list(ps)[0] == u):
                drop[u] = True
                remove_child(u)

    def remove_parent(v):
        for u in links[v]:
            if u == v:
                continue
            parents[u].remove(v)
            ps = parents[u]
            if not ps or (len(ps) == 1 and list(ps)[0] == u):
                drop[u] = True
                remove_parent(u)

    drop = [False] * n
    for v, s in enumerate(links):
        if v == n - 1:
            continue
        if not s or (len(s) == 1 and list(s)[0] == v):
            drop[v] = True
            remove_child(v)

    for v, s in enumerate(parents):
        if v == 0:
            continue
        if not s or (len(s) == 1 and list(s)[0] == v):
            drop[v] = True
            remove_parent(v)

    # print(drop)
    # print(links)
    # print(parents)

    return drop


