def gcd_l(x):
    max_element = 1
    if len(x)==1:
        return x[0]
    elif len(x) == 2:
        return max(x[0], x[1])
    else:
        element_1 = gcd(x[0], x[1])
        element_2 = gcd(x[len(x) - 3], x[len(x)-1])
        element = max(element_1, element_2)

        for i in range(2,len(x)):
            element=gcd(element,x[i])
            if gcd(element, x[i]) > max_element:
                max_element = element

        return max_element

