def bfs(branch,n,start):
    arrival = [0 for i in range(n+1)]
    q = [start]
    arrival[q[0]]=1
    while len(q) >= 1:
        for k in range(len(branch[q[0]])):
            if arrival[branch[q[0]][k]] == 0:
                arrival[branch[q[0]][k]] = arrival[q[0]] + 1
                q.append(branch[q[0]][k])
        q.pop(0)
    return arrival

def traceback(graph,start,goal,n):
    arrival = bfs(graph,n,start)
    invarrival = bfs(graph,n,goal)
    path = []
    for i in range(2,n):
        if arrival[i] < arrival[goal] and invarrival[i] < invarrival[start]:
            path.append(i)
    return path



